Tiles.prototype.isFloor = function(position, frame, camera){
	var y = Math.floor((position.y+frame.height)/16);
	var x = Math.floor((position.x+frame.width)/16);
	var xL = Math.floor(x);
	//var xC = Math.floor(x-1);
	var xR = Math.floor(x-2);
	var LTile = this.map1[y*700 + xL]; //console.log(LTile);
	//var CTile = this.map1[y*70 + xC];
	var RTile = this.map1[y*700 + xR];
	var isSolidL = this.tiles[LTile-1].solid;
	//var isSolidC = this.tiles[CTile-1].solid;
	var isSolidR = this.tiles[RTile-1].solid;

	if(isSolidL) {
		return true;
	}/*
	else if(isSolidC) {
		return true;
	}*/
	else if(isSolidR) {
		return true;
	}
	else {
		return false
	}
}

Tiles.prototype.getFloor = function(position, frame) {
	return (Math.floor((position.y + frame.height)/16) * 16) - frame.height;
}
